<tspan x="406.75" y="27.2265739" textLength="7.75"> </tspan>
</text>
</g>
<g transform="matrix(1, 0, 0, 1, 23.3031616, 87.3346558)">
  <text font-family="Arial" font-size="10.5pt" fill="#595959">
<tspan x="0" y="13.613287" textLength="232">Unique selling point of the lunch box :</tspan>
<tspan x="0" y="30.4132881" textLength="304.875">A group of nutritionists investigated and designed</tspan>
<tspan x="304.875" y="30.4132881" textLength="7.75">  </tspan>
<tspan x="312.625" y="30.4132881" textLength="225.625">to fit in to 3 different category needs.</tspan>
<tspan x="0" y="47.2132874" textLength="113.25">Organic vegetable</tspan>
<tspan x="0" y="80.81329" textLength="239.75">What should be included in our service</tspan>
<tspan x="47" y="97.6133" textLength="4.625">-</tspan>
<tspan x="72" y="97.6133" textLength="150.5">Mainly focus on take out</tspan>
<tspan x="47" y="114.4133" textLength="4.625">-</tspan>
<tspan x="72" y="114.4133" textLength="282.125">Ppl can preorder food(breakfast-lunch-dinner)</tspan>
<tspan x="47" y="131.2133" textLength="4.625">-</tspan>
<tspan x="72" y="131.2133" textLength="558.375">Discount price for gym members and distinguished menu provided(menu for muscle gains,</tspan>
<tspan x="630.375" y="131.2133" textLength="3.875"> </tspan>
<tspan x="72" y="148.0133" textLength="82.25">gain loss etc)</tspan>
<tspan x="154.25" y="148.0133" textLength="3.875"> </tspan>
<tspan x="47" y="164.8133" textLength="4.625">-</tspan>
<tspan x="72" y="164.8133" textLength="114.75">Non-members can</tspan>
<tspan x="186.75" y="164.8133" textLength="3.875"> </tspan>
<tspan x="40" y="181.613281" textLength="9.375" font-size="21pt">-</tspan>
<tspan x="72" y="181.613281" textLength="172.125">(Pre-order, delivery service)</tspan>
</text>
</g>
</g>

<div class="slide" name="slide" id="slideslideIface19" ><svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" width="10in" height="5.625in" pointer-events="none" viewBox="0 0 720 405" version="1.1">

<g transform="matrix(1, 0, 0, 1, 31.7427673, -96.1732254)">
  <text font-family="Arial" font-size="12pt" fill="#000000">
<tspan x="157.007874" y="143.582443" textLength="342.5">Overall introduction of your project (background)</tspan>
</text>
</g>
<g transform="matrix(1, 0, 0, 1, 31.7421265, 59.0551147)">
  <text font-family="Arial" font-size="10.5pt" fill="#ff0000">
<tspan x="0" y="13.613287" textLength="45">Name :</tspan>
<tspan x="45" y="13.613287" textLength="3.875"> </tspan>
<tspan x="48.875" y="13.613287" textLength="96.25" fill="#000000">Healthy Square</tspan>
<tspan x="0" y="47.2132874" textLength="133.5">What kind of service?</tspan>
<tspan x="133.5" y="47.2132874" textLength="3.875"> </tspan>
<tspan x="137.375" y="47.2132874" textLength="3.875" fill="#595959">:</tspan>
<tspan x="141.25" y="47.2132874" textLength="3.875"> </tspan>
<tspan x="0" y="64.01329" textLength="615.875" fill="#595959">providing a healthy meal box &amp; protein shakes for take away and open it in Crossfit Gym (Pre-order,</tspan>
<tspan x="615.875" y="64.01329" textLength="3.875"> </tspan>
<tspan x="0" y="80.81329" textLength="100.875" fill="#595959">delivery service)</tspan>
<tspan x="0" y="131.2133" textLength="191.5">The need of adding the service</tspan>
<tspan x="191.5" y="131.2133" textLength="3.875"> </tspan>
<tspan x="195.375" y="131.2133" textLength="3.875" fill="#595959">:</tspan>
<tspan x="11" y="148.0133" textLength="8.5" fill="#595959">●</tspan>
<tspan x="36" y="148.0133" textLength="428.875" fill="#595959">Convenience for gym lover to have a healthy meal right after exercise</tspan>
<tspan x="11" y="164.8133" textLength="8.5" fill="#595959">●</tspan>
<tspan x="36" y="164.8133" textLength="593.25" fill="#595959">Targeting busy working class people and students who rarely cook at home and eager to have a</tspan>
<tspan x="629.25" y="164.8133" textLength="3.875"> </tspan>
<tspan x="36" y="181.613281" textLength="75.25" fill="#595959">healthy diet.</tspan>
<tspan x="0" y="215.213257" textLength="186.25">Current situation of gym in HK</tspan>
<tspan x="186.25" y="215.213257" textLength="3.875"> </tspan>
<tspan x="190.125" y="215.213257" textLength="445" fill="#595959">e.g. the growth no. of gym users, the rate of ppl concerning about health</tspan>
<tspan x="11" y="232.013245" textLength="4.625">-</tspan>
<tspan x="36" y="232.013245" textLength="71.375">Market size</tspan>
<tspan x="107.375" y="232.013245" textLength="3.875"> </tspan>
<tspan x="11" y="248.813232" textLength="4.625" fill="#595959">-</tspan>
<tspan x="36" y="248.813232" textLength="87.5">Target group :</tspan>
<tspan x="123.5" y="248.813232" textLength="7.75">  </tspan>
<tspan x="131.25" y="248.813232" textLength="429.5" fill="#595959">millennials(people born from 1981 to 1996), regular Crossfit members</tspan>
<tspan x="11" y="265.61322" textLength="4.625" fill="#595959">-</tspan>
<tspan x="36" y="265.61322" textLength="52.75">Location</tspan>
<tspan x="88.75" y="265.61322" textLength="3.875"> </tspan>
<tspan x="92.625" y="265.61322" textLength="480.875" fill="#595959">: CrossFit (targeting 4 branches,mainly located in Kennedy Town and Central)</tspan>
<tspan x="11" y="285.647919" textLength="4.625" fill="#595959">-</tspan>
<tspan x="36" y="285.647919" textLength="38.125">Vision</tspan>
<tspan x="74.125" y="285.647919" textLength="3.875"> </tspan>
<tspan x="78" y="285.647919" textLength="3.875" fill="#595959">:</tspan>
<tspan x="81.875" y="285.647919" textLength="214.875" font-family="Calibri" font-size="13.5pt" fill="#000000">create a new healthy lifestyle</tspan>
</text>
</g>
</g>
</svg></div>
<div class="slide" name="slide" id="slideslideIface20" ><svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" width="10in" height="5.625in" pointer-events="none" viewBox="0 0 720 405" version="1.1">
  <g text-rendering="geometricPrecision" pointer-events="painted" transform="scale(1,1)">
<rect x="0" y="0" width="720" height="405" fill="#ffffff" />
<g transform="matrix(1, 0, 0, 1, 31.7421265, 97.9448853)">
  <text font-family="Calibri" font-weight="bold" font-size="13.5pt" fill="#000000">
<tspan x="0" y="38.448" textLength="45.125">idea 1</tspan>
<tspan x="45.125" y="38.448" textLength="4.125"> </tspan>
<tspan x="49.25" y="38.448" textLength="527" font-weight="normal">: Upgrade business (Collaboration of a Gym and healthy diet restaurant)</tspan>
<tspan x="0" y="81.648" textLength="582.75" font-weight="normal">Service provide both exercise and healthy diet and social activities (networking)</tspan>
<tspan x="9" y="103.248" textLength="5.5" font-weight="normal">-</tspan>
<tspan x="36" y="103.248" textLength="391.375" font-weight="normal">A nutritionist Provides customized diet for individuals</tspan>
<tspan x="9" y="124.848" textLength="5.5" font-weight="normal">-</tspan>
<tspan x="36" y="124.848" textLength="601.5" font-weight="normal">only members of gym can be served customized diet and the regular customers of</tspan>
<tspan x="637.5" y="124.848" textLength="4.125" font-weight="normal"> </tspan>
<tspan x="36" y="146.448013" textLength="350.75" font-weight="normal">the restaurant can only order food in the menu.</tspan>
<tspan x="386.75" y="146.448013" textLength="4.125" font-weight="normal"> </tspan>
<tspan x="9" y="168.048019" textLength="5.5" font-weight="normal">-</tspan>
<tspan x="36" y="168.048019" textLength="608.875" font-weight="normal">Hold a session to provide an opportunity to form a group from same/cross industry</tspan>
<tspan x="644.875" y="168.048019" textLength="4.125" font-weight="normal"> </tspan>
<tspan x="36" y="189.648026" textLength="598.125" font-weight="normal">for information exchanging and socialising (weekly based) e.g. categorized people</tspan>
<tspan x="634.125" y="189.648026" textLength="4.125" font-weight="normal"> </tspan>
<tspan x="36" y="211.248032" textLength="315.875" font-weight="normal">into different group based on their interest</tspan>

<tspan x="0" y="27.2265739" textLength="132.625">Guidelines</tspan>
</text>
</g>
<g transform="matrix(1, 0, 0, 1, 31.7421265, 97.9448853)">
  <text font-family="Arial" font-size="8.25pt" fill="#000000">
<tspan x="0" y="10.6961536" textLength="633.75">Throughout the semester, as a group, you will develop a new service design or redesign an existing service which will include your</tspan>
<tspan x="633.75" y="10.6961536" textLength="3"> </tspan>
<tspan x="0" y="23.8961525" textLength="629.875">development of a service blueprint of the service to gain expertise with using that tool. The total grade for this group project will be</tspan>
<tspan x="629.875" y="23.8961525" textLength="3"> </tspan>
<tspan x="0" y="37.0961533" textLength="650.25">based a final group presentation as well as a written proposal (worth 150 points). I will provide more details about the assignment step</tspan>
<tspan x="650.25" y="37.0961533" textLength="3"> </tspan>
<tspan x="0" y="50.29615" textLength="96.375">by step in the class.</tspan>
<tspan x="0" y="63.4961472" textLength="3"> </tspan>
<tspan x="0" y="76.6961441" textLength="122" font-weight="bold">Group Project Grading:</tspan>
<tspan x="122" y="76.6961441" textLength="531.375"> In real-world working environment, you rarely can get work done alone. You will often find yourself working in</tspan>
<tspan x="653.375" y="76.6961441" textLength="3"> </tspan>
<tspan x="0" y="89.89614" textLength="642.875">a project team with people from the same department or even across functions. A can-do attitude and teamwork ability are critical for</tspan>
<tspan x="642.875" y="89.89614" textLength="3"> </tspan>
<tspan x="0" y="103.096138" textLength="644.75">today’s business leader. To encourage a constructive team work culture, each group member will be evaluated based on two scores:</tspan>
<tspan x="644.75" y="103.096138" textLength="3"> </tspan>
<tspan x="0" y="116.296135" textLength="640.375">(1) a group performance score (worth 70% of the total score in each group project assignment). This score will be the same for each</tspan>
<tspan x="640.375" y="116.296135" textLength="3"> </tspan>
<tspan x="0" y="129.49614" textLength="654.75">group member based on the overall group performance; (2) an individual contribution score (worth 30% of the total score in each group</tspan>
<tspan x="654.75" y="129.49614" textLength="3"> </tspan>
<tspan x="0" y="142.696136" textLength="572.5">project assignment). This score will be given based on the peer evaluation from the group members (see Appendix II).</tspan>
</text>
</g>
</g>
